import * as React from 'react';
import PropTypes from 'prop-types';

function App() {
  return (
    <React.Fragment>
      <h1>coi-common-ui</h1>
      <h3>Cisco One Identity Common User Interface</h3>
    </React.Fragment>
  );
}

App.propTypes = {
  title: PropTypes.string
};

export default App;
